emails = {}
User.joins(:role).where(roles: { organization_id: 8}).each do |user|
emails[user.email] = user.id
end

images = images.group_by do |image|
	image["report_id"].to_s
end

data_parts = {
    137 => "Número de sillón",
    116 => "Lugar",
    120 => "Comentarios",
    119 => "Requerimientos",
    # 138 => "Detalle requerimientos",
    117 => "Número de caja",
    118 => "Número de contador",
    115 => "Categoría"
}

data_mapping = {}
data_parts.each do |key, value|
	d2 = DataPart.where(name: value).order("created_at DESC").first
	data_mapping[key.to_s] = d2.id.to_s
end


def transform_attrs(data_mapping, attrs)
	new_attrs = {}
	attrs.each do |key, value|
		new_attrs[data_mapping[key]] = value
	end
	new_attrs
end

reports.sort! { |r1, r2| DateTime.parse(r1["created_at"]).to_i <=> DateTime.parse(r2["created_at"]).to_i }
new_reports = []
reports.each do |report_hash|
	if not Report.exists? report_hash["id"]
		details = report_hash["dynamic_attributes"].delete("138")
		report_hash["dynamic_attributes"] = transform_attrs(data_mapping, report_hash["dynamic_attributes"])
		Report.transaction do
			if report_hash["assigned_user_email"].present?
				report_hash["assigned_user_id"] = emails[report_hash["assigned_user_email"]]
			end
			if report_hash["dynamic_attributes"].dig("107", "id") == "57bc93bbf232984f1cd570e8"
				# No tiene requerimientos
				report_hash["dynamic_attributes"]["107"] = {
					"id" => "4165",
					"value" => "No hay requerimientos"
				}
			elsif report_hash["dynamic_attributes"].dig("107", "id") == "57bc93c6f232984f1cd570e9"
				if details.present?
					report_hash["dynamic_attributes"]["107"] = {
						"value" => details["value"]
					}
				else
					report_hash["dynamic_attributes"]["107"] = {
						"value" => "No se detallaron los requerimientos"
					}
				end
			else
				report_hash["dynamic_attributes"]["107"] = {
					"id" => "4165",
					"value" => "No hay requerimientos"
				}
			end
			report_hash["creator_id"] = emails[report_hash["creator_email"]]
			report_hash.delete("assigned_user_email")
			report_hash.delete("creator_email")
			report_hash.delete("pdf_url")
			limit_date = report_hash.delete "limit_date"
			report = Report.new(report_hash)
			report.ignore_pdf = true
			report.initial_location_attributes = locations[report.id.to_s]
			report.state_id = 25
			report.save!
			report.update_column :limit_date, limit_date 
			new_reports << report
			if images[report.id.to_s].present?
				images[report.id.to_s].each do |image_hash|
					image = Image.new(image_hash)
					image.save!
				end
			end
		end
	else
		new_reports << Report.find(report_hash["id"])
	end
end

new_reports.each do |report|
	report.generate_pdf
end
